import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";

import Menu from "./component/pages/menu"
import {FooterUp , FooterDown} from "./component/pages/footer"

function App() {
  return (
    <div className="App">
      <div className="menu">
        <Menu/>
      </div>

     <div className="footer">
       <FooterUp/>
       <FooterDown/>

     </div>
    </div>
  );
}

export default App;
